      "description": "<p class=\"top\"><strong>Why</strong> <strong>you'll</strong> <strong>like</strong> <strong>it......</strong> <strong></strong><br>Martin &amp; Co are delighted to offer for sale this very well presented, one bedroom freehold corner mews style property located in a small quiet cul-de-sac, close to the town centre and all local amenities. The property benefits from brand new carpets and floor coverings throughout.<br><br>A stand out feature of this lovely home is the enclosed private side garden and driveway providing parking for two vehicles.<br><br>The property comprises and benefits from an entrance porch leading to the open plan living area and separate modern kitchen, with built in oven, hob, and free standing washer/dryer and fridge. On the first floor there is a double bedroom with built-in wardrobe and modern bathroom with shower over the bath.<br><br>Externally there is a front and enclosed courtyard garden and the benefit of driveway parking for two vehicles.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury a small market town, situated on the western edge of Wiltshire beside the chalk downlands that form Salisbury Plain.<br><br>The most famous landmark of the area is the vastly impressive hillside chalk carved White Horse which is both the oldest and largest in Wiltshire. The surrounding countryside makes it a delight for both the walker and cyclist and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Tanya Williams, Ed Hames or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong> Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed</p>",
