      "description": "<p class=\"top\">Daykin Estates are delighted to offer for sale, this well presented bedroom end terraced Victorian property situated within Westbury. This character property is a short walk to shops, schools, parks, pubs and other local amenities.<br><br>Features include UPVC double glazing, gas central heating, spacious living room, dining room, kitchen three double bedrooms, bathroom, conservatory, insulated loft and low maintenance rear garden. This property benefits from parking to the rear. Period features are showcased throughout including, working fireplaces and exposed beams.<br><br>Westbury is a small medieval market town which is famous for its White Horse hill-carving.<br>The town offers a range of facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets and a post office. There is also a selection of coffee shops, restaurants, and public houses. Westbury is well positioned for all major road and railway connections with the mainline railway station offering links to London, Wales and the whole of the Southwest of England.</p><h3 class=\"listing-desc-header top\"><strong>Entrance Hall</strong></h3><p class=\"top\">Upon Entering the property you will find the porch area this then leads into the spacious entrance hall with doors leading to the, living room, dining room, understairs cupboard which is great for additional storage, Kitchen, conservatory and downstairs cloakroom. Stairs also leading to the first floor.</p><h3 class=\"listing-desc-header top\"><strong>Living Room</strong></h3><p class=\"top\">The spacious living room benefits from original open fireplace being focal points of the room. Wooden flooring throughout, Large UPVC double glazed window providing plenty of light to flood the room. Ample space for furnishings.</p><h3 class=\"listing-desc-header top\"><strong>Dining Room</strong></h3><p class=\"top\">The generous sized dining room consists of a large window to rear aspect allowing views into the conservatory, food hatch is featured and a wall mounted radiator.</p><h3 class=\"listing-desc-header top\"><strong>Kitchen</strong></h3><p class=\"top\">A step then leads down into the kitchen. The kitchen offers a range of matching wall and base units with wood effect work surfaces, inset electric oven, inset electric hob ceramic sink, UPVC double glazed window to the rear. Other benefits also include plenty of countertop space, integrated fridge/freezer and space for white goods. Tiled backsplash and ceramic tiled flooring throughout. Steps to the rear of the kitchen also lead to the downstairs cloakroom.</p><h3 class=\"listing-desc-header top\"><strong>Conservatory</strong></h3><p class=\"top\">As you leave the kitchen, you enter the conservatory area. This area benefits from ample space for additional furnishings, wall mounted radiator to the rear, ceramic flooring throughout. UPVC double glazed windows surrounding the top walls and a large french door allowing access to the garden. This room is bright and allows plenty of natural light within.</p><h3 class=\"listing-desc-header top\"><strong>Bathroom</strong></h3><p class=\"top\">The family bathroom comprises of an obscure window, walk in shower cubicle, large bath with plenty of shelf space surrounding, low level W.C, pedestal wash hand basin within vanity unit, tiled splash backs, built in halogen spotlights, chrome heated towel rail and ceramic tiled flooring.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom One</strong></h3><p class=\"top\">This well presented double bedroom comprises of a large window to rear aspect, carpet throughout, and wall mounted radiator. This room also benefits from high ceilings and ample space for furniture.</p><h3 class=\"listing-desc-header top\"><strong>Office</strong></h3><p class=\"top\">Currently utilized. This room benefits from carpet throughout, double glazed window to front aspect and wall mounted radiator. This generous sized room holds so much potential.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Three</strong></h3><p class=\"top\">The third bedroom is located to the front of the property. This room features a large UPVC double glazed window to front aspect allowing plenty of natural light. This room would be perfect for additional storage and has great potential.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Four</strong></h3><p class=\"top\">Bedroom Four is located on the second floor. Stairs leading into this spacious loft room. This bedroom features, carpet throughout, original exposed beans on the ceiling, wall mounted radiator to the rear and a large UPVC double glazed window. A fitted cupboard is featured in this room allowing additional storage space and access to the insulated loft.</p><h3 class=\"listing-desc-header top\"><strong>Garden</strong></h3><p class=\"top\">This fully enclosed, low maintenance courtyard styled garden comprises of a large stone area ideal for additional seating and garden furnishings. To the rear of the garden there is a gate providing convenient access to rear of the property where there is parking.</p>",
