      "thumbnail_url": "https://lid.zoocdn.com/80/60/9aa66cba31a66a5e2ee4eea19e978d9d75f9c67d.jpg",
      "description": "<p class=\"top\">No onward chain - A charming one double bedroom cottage full of character, situated on the popular Warminster Road.</p><h3 class=\"listing-desc-header top\"><strong>Location</strong></h3><p class=\"top\">Westbury is a small medieval town that lies not far from its famous White Horse hill-carving at the western extremity of Salisbury Plain. Westbury offers a range of shopping and leisure facilities including, library, sports centre, schools, churches, doctors, dentist surgeries, post office and the oldest swimming pool in the country. The main railway line has fantastic links to Bath, Bristol and London. Travelling by car to Salisbury, Bristol and Swindon takes approximately one hour making it very desirable for commuters.</p><h3 class=\"listing-desc-header top\"><strong>Description</strong></h3><p class=\"top\">No onward chain - This charming one bedroom cottage is situated on the popular Warminster Road. The accommodation comprises a living room, kitchen, one double bedroom, dressing room and bathroom. Other benefits include a small courtyard garden and within walking distance to town and other local amenities.</p><h3 class=\"listing-desc-header top\"><strong>Living Room</strong></h3><p class=\"top\">When accessing the property, you enter through a UPVC double glazed door, There is a UPVC double glazed window to front aspect, open fireplace, matching wall lights, capped gas heater and electric wall mounted heater and obscure glass door to kitchen.</p><h3 class=\"listing-desc-header top\"><strong>Kitchen</strong></h3><p class=\"top\">The kitchen had a UPVC double glazed window to rear and door to courtyard garden, inset stainless steel sink with chrome mixer tap, inset electric hob and built in oven, space for washing machine and fridge freezer</p><h3 class=\"listing-desc-header top\"><strong>First Floor Landing</strong></h3><p class=\"top\">From the landing there is a door to bedroom and opening to dressing room and UPVC window to side aspect.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom</strong></h3><p class=\"top\">The bedroom has a UPVC window to front aspect, two built in wardrobes and electric mounted wall heater.</p><h3 class=\"listing-desc-header top\"><strong>Dressing Room</strong></h3><p class=\"top\">The dressing room has an obscure UPVC double glazed window to rear and door to bathroom</p><h3 class=\"listing-desc-header top\"><strong>Bathroom</strong></h3><p class=\"top\">The bathroom has a close coupled W.C, pedestal wash hand basin and panelled bath, with mains fed overhead shower.</p><h3 class=\"listing-desc-header top\"><strong>Exterior</strong></h3><h3 class=\"listing-desc-header top\"><strong>Courtyard</strong></h3><p class=\"top\">The paved courtyard garden is a small outside area currently used for bin storage and drying clothing.</p><h3 class=\"listing-desc-header top\"><strong>Additional Information</strong></h3><p class=\"top\">Council Tax Band - A</p><h3 class=\"listing-desc-header top\"><strong>Directions</strong></h3><p class=\"top\">From Westbury High Street go out into Edward Street and at the 'T' junction turn right onto the Warminster Road. Go over the next two mini roundabouts and the property can be found on the left.</p><p class=\"top\">You may download, store and use the material for your own personal use and research. You may not republish, retransmit, redistribute or otherwise make the material available to any party or make the same available on any website, online service or bulletin board of your own or of any other party or make the same available in hard copy or in any other media without the website owner's express prior written consent. The website owner's copyright must remain on all reproductions of material taken from this website.</p>",
