      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this beautifully presented four/five bedroom detached family home located within the heart of Westbury and close to all amenities.<br><br>A standout feature of this lovely property is its spacious living room. The room offers ample space for all lounge furnishings as well as a feature bay window, a fire place with open fire, and high ceilings.<br><br>The property comprises and benefits from uPVC double glazing, gas central heating, spacious lounge with open fire and bay window, fitted kitchen with dual aspect windows and space for appliances, separate dining room with French doors leading out onto the garden, a study, and downstairs W/C.<br><br>Leading upstairs brings you to three double bedrooms, with the master bedroom offering built in wardrobes and feature fire place and the second bedroom offering a feature fireplace. The fourth bedroom is good size single bedroom, and there is a modern fitted shower room including a double shower, wash hand basin and W/C.<br><br>Externally there is a fully enclosed low maintenance rear garden which is mainly laid to artificial lawn. A large patio area gives space for garden furnishings. The garden is lined with mature shrubs and plants and has a pathway leading to the rear where you will find double doors into the garage as well as a gateway to the drive and access into the garage with up and over door. A convenient gateway gives access to the front of the home offering a steel fenced courtyard garden.<br><br>Agents Note:<br><br>This fantastic property comes to the market with the added benefit of no onward chain. An internal viewing is highly recommended to fully appreciate what this lovely home has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong> Westbury is a small market town is situated at the western edge of Wiltshire beside the chalk down lands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire, makes it a delight for both the walker and cyclist and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Tanya Williams, Kieran Perks, Kerri Gunning or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
