      "thumbnail_url": "https://lid.zoocdn.com/80/60/408e31735e0225d354a68a82084f9eee5f6a1c76.jpg",
      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this immaculately presented three bedroom detached family home located within a quiet tucked away position.<br><br>A standout feature of this lovely property is the modern fitted kitchen/dining room. The room offers ample wall and base mounted cabinets, a four seater breakfast bar and space for a good size dining table and chairs. Dual aspect windows bring in an abundance of natural light and a door gives access into the enclosed rear garden.<br><br>The property comprises and benefits from uPVC double glazing, gas central heating, spacious lounge, fitted kitchen/dining room, conservatory, and three generous size bedrooms with an en-suite to the master bedroom. Bedroom two and three are served by the family bathroom suite.<br><br>Externally there is a fully enclosed low maintenance rear garden which is laid to gravel and artificial lawn. There is a good size garden shed offering power and lighting. A gate gives access to the side where you will find driveway parking for multiple vehicles and access into the single garage with up and over door.<br><br>An internal viewing is highly recommended to fully appreciate what this lovely property has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury is a small market town and is situated on the western edge of Wiltshire, beside the chalk down lands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse, which is both the oldest and largest White Horse in Wiltshire. The area is a delight for both walkers and cyclists and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England<br><br><strong>viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Kerri Gunning, Kieran Perks, Tanya Williams or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
