      "description": "<p class=\"top\"><br><b>Summary</b><br>Bremeridge Road is a stunning three bedroom semi-detached home. Set in the historic town of Westbury. The property is situated in proximity to the town centre, local amenities as well as Westbury Railway Station with a regular direct Paddington Service.<br><br><b>Description</b><br>Set in the historic town of Westbury, Bremeridge Road is a tastefully decorated three bedroom, semi-detached home. The property is situated in proximity to the town centre, local amenities as well as the iconic Westbury white horse.<br>You are welcomed into the home with an entrance hall that leads into a renovated, beautifully sized kitchen diner. The living room is a bright and spacious area which benefits from french doors that lead into the conservatory. Upstairs there is a landing with loft access, three bedrooms as well as a family bathroom. To the front of the property, there is a driveway with space for one vehicle, a front garden set in a cul de sac location and a rear garden that boasts a lawn as well as a patio dining area, perfect for the summer months.<br>Westbury, set on the Wiltshire and Somerset border is a wonderful town offering a wealth of local amenities including three major super markets, as well as a range of independent businesses and restaurants. The town has stunning historic buildings including the first ever public swimming pool set in the heart of the old town. Westbury is famous for its White Horse carved into the Salisbury Plains welcoming you for stunning countryside walks and cycle routes.<br><br><b>Downstairs</b><br><br><b>Entrance Hall</b><br>Double glazed door to side. Radiator. Storage cupboard.<br><br><b>Lounge</b> 16' 5\" x 12' ( 5.00m x 3.66m )<br>Double glazed window to rear. Double glazed french doors. Radiator. Carpeted. TV point.<br><br><b>Kitchen Diner</b> 16' 5\" max x 16' 2\" max ( 5.00m max x 4.93m max )<br>Two double glazed windows to front. Tiled walls. Porcelain sink and drainer. Four ringed gas hob. Integrated dishwasher. Integrated fridge freezer. Radiator. Gas boiler. Wall and base units.<br><br><b>Conservatory</b> 14' 6\" x 8' 11\" ( 4.42m x 2.72m )<br><br><b>Upstairs</b><br><br><b>Landing</b><br>Access to partially boarded loft and ladder. Radiator. Carpeted.<br><br><b>Bedroom One</b> 12' 9\" max x 12' 9\" max ( 3.89m max x 3.89m max )<br>Double glazed window to rear. Radiator. Carpeted.<br><br><b>Bedroom Two</b> 12' 8\" x 8' 5\" ( 3.86m x 2.57m )<br>Double glazed window to front. Airing cupboard. Radiator. Carpeted.<br><br><b>Bedroom Three</b> 9' 8\" x 6' 6\" ( 2.95m x 1.98m )<br>Double glazed window to rear. Radiator. Carpeted.<br><br><b>Bathroom</b><br>Double glazed window to front. WC. Wash hand basin and vanity. Bath tub. Overhead shower. New wall tiles.<br><br><b>Outside</b><br><br><b>Front Garden</b><br>Grass lawn. Water tap.<br><br><b>Rear Garden</b><br>Side gate access. Grass lawn. Patio dining area.<br><br><b>Driveway</b><br>Space for one vehicle.<br><br>1. Money laundering regulations: Intending purchasers will be asked to produce identification documentation at a later stage and we would ask for your co-operation in order that there will be no delay in agreeing the sale.\r<br>2. General: While we endeavour to make our sales particulars fair, accurate and reliable, they are only a general guide to the property and, accordingly, if there is any point which is of particular importance to you, please contact the office and we will be pleased to check the position for you, especially if you are contemplating travelling some distance to view the property.\r<br>3. The measurements indicated are supplied for guidance only and as such must be considered incorrect.\r<br>4. Services: Please note we have not tested the services or any of the equipment or appliances in this property, accordingly we strongly advise prospective buyers to commission their own survey or service reports before finalising their offer to purchase.\r<br>5. These particulars are issued in good faith but do not constitute representations of fact or form part of any offer or contract. The matters referred to in these particulars should be independently verified by prospective buyers or tenants. Neither sequence (UK) limited nor any of its employees or agents has any authority to make or give any representation or warranty whatever in relation to this property.</p>",
