      "thumbnail_url": "https://lid.zoocdn.com/80/60/61c40e5aac6788ed238484cdfa174be9823a42b7.jpg",
      "description": "<p class=\"top\"><strong>Why</strong> <strong>you'll</strong> <strong>like</strong> <strong>it.......</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this well presented two bedroom, semi-detached family home located within a quiet location and close walking distance to local amenities.<br><br>A standout feature of this lovely property is the fitted kitchen/dining room. The room benefits from ample wall and base mounted cabinets, space for appliances and space for a good size dining table and chairs. A large window brings in an abundance of natural light and a door which lead out onto the enclosed rear garden.<br><br>The property comprises and benefits from upvc double glazing, modern electric heating, spacious lounge, fitted kitchen/dining room, two generous size bedrooms and the three piece bathroom suite.<br><br>Externally there is a fully enclosed rear garden which is mainly laid to lawn. The garden is lined with mature trees and shrubs and offers a large patio area with space for garden furnishings. A rear door gives access into the single garage.<br><br>The front of the home benefits from driveway parking and an up and over door into the garage.<br><br>Agents Note:<br><br>The property comes to the market with the added benefit of no onward chain. An internal viewing is highly recommended to fully appreciate what this lovely home has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury is a small market town and is situated on the western edge of Wiltshire, beside the chalk down lands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse, which is both the oldest and largest White Horse in Wiltshire. The area is a delight for both walkers and cyclists and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England<br><br><strong>viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Kerri Gunning, Kieran Perks, Tanya Williams or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>infromation</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
