      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this beautifully presented four/five bedroom detached family home which includes a brilliant one-bedroom annex, located in one of Westbury's most sought-after locations.<br><br>A standout feature of this lovely property is its fantastic flexible one-bedroom annex. The annex can be entered from the front of the property as well as the utility room through hidden doors. The annex offers a fantastic double bedroom, an \"L\" shaped reception room and a shower room with a steam shower, wash hand basin and W/C. There is a further door which leads out to the enclosed rear garden.<br><br>The property comprises and benefits from uPVC double glazing, gas central heating, spacious lounge with double sided wood burner, open plan kitchen/breakfast room, utility room, conservatory, and a further reception room/bedroom.<br><br>You then enter the annex which includes a spacious bedroom, reception room and shower room.<br><br>Leading upstairs brings you to the landing with doors leading to the three bedrooms and family bathroom suite. The master bedroom offers space for bedroom furnishings, built in wardrobes and an en-suite.<br><br>Externally there is a fully enclosed rear garden which is mainly laid to lawn. The garden is lined with mature trees, shrubs and plants. There is a raised patio area which is great for entertaining and offers space for garden furnishings. Leading down the steps brings you to a further generous patio area which offers a pergola and a hot tub which will be included within the sale. To the rear of the garden there is an impressive summer house which has ample built-in seating and a fire pit in the Centre.<br><br>The front of the home offers a large driveway with parking for multiple vehicles. Double gates lead to a carport to the side of the property.<br><br>Agents Note:<br><br>This lovely property comes to the market with the added benefit of no onward chain. An internal viewing is highly recommended to fully appreciate what this brilliant home has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury a small market town, situated on the western edge of Wiltshire beside the chalk downlands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire. The surrounding countryside makes it a delight for both the walker and cyclist and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Tanya Williams, Kieran Perks, Kerri Gunning, Kim Butt or Ed Hames.<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
