      "thumbnail_url": "https://lid.zoocdn.com/80/60/6027d62c391a7cbd216b3903ab569ec9e8bbbf64.jpg",
      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this fantastic four bedroom detached 1960's home located within a quiet and sought after location along a quiet lane that leads to a nearby woods, offering beautiful countryside walks. The property offers fantastic scope for an extension subject to planning permission!<br><br>A standout feature of this brilliant property is its spacious lounge. The \"L\" shaped room has ample space for all lounge furnishings and offers triple aspect windows which bring in an abundance of natural light. The room over looks the front and rear garden.<br><br>The property comprises and benefits from uPVC double glazing, gas central heating, spacious lounge, two further good size reception rooms, fitted kitchen, utility room, W/C, integral garage, three double bedrooms and the family bathroom suite.<br><br>Externally there is a fully enclosed rear garden which is mainly laid to lawn and lined with mature trees, shrubs and plants. To the rear there is a good size garden shed. A large patio area offers space for garden furnishings. There is a convenient side gate which gives access to the front of the home where you will find a large lawned area and the driveway with parking for multiple vehicles. An up and over door gives access into the single garage.<br><br>Agents Note:<br><br>This property comes to the market with the added benefit of no onward chain. An internal viewing is highly recommended to fully appreciate what this lovely home has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury a small market town is situated at the western edge of Wiltshire beside the chalk down lands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire, makes it a delight for both the walker and cyclist and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Tanya Williams, Kieran Perks, Kerri Gunning or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
