      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this well presented four/five bedroom detached family home located within a sought-after location offering far reaching views of Westbury and beyond.<br><br>A standout feature of this fantastic property is its modern fitted kitchen/dining room which offers ample wall and base mounted cabinets, a breakfast bar, integrated fridge freezer and dishwasher and space for a good size dining table and chairs. An external doorway gives ease of access to the gravelled driveway.<br><br>The property comprises and benefits from Upvc double glazing, gas central heating, spacious lounge/family room, modern fitted kitchen/dining room, conservatory, downstairs W/C, four good size bedrooms, a four-piece bathroom suite and an attic room.<br><br>Externally there is a fully enclosed low maintenance rear garden. A large patio area is accessed from the conservatory which offers ample space for all garden furnishings. Leading up the steps brings you to a large Pergola which would make a great entertaining spot and gives access into the heated outdoor swimming pool which has recently been re-lined. The rear of the garden is laid to slate chippings with mature shrubs and plants bordering giving the garden a great deal of privacy. The far corner offers a summer house which has the benefit off electricity.<br><br>The front of the property has a large driveway which is mainly laid to gravel with parking for multiple vehicles. There is the main doorway into the property to the left-hand side as well as a rear doorway with access into the kitchen. A detached single garage is located to the right-hand side of the home and offers an electric roller shutter door with power, lighting and plumbing inside.<br><br>Agents Note:<br>This brilliant home comes to the market with the added benefit of no onward chain. An internal viewing is highly recommended to fully appreciate what this lovely home has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong> Westbury a small market town, situated on the western edge of Wiltshire beside the chalk down lands that form Salisbury Plain.<br><br>The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire. The surrounding countryside makes it a delight for both the walker and cyclist and also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong> To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Tanya Williams or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong> Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
