      "listing_date": "2022-05-18 13:38:26",
      "description": "<p class=\"top\">Daykin Estates are delighted to offer for sale, this well presented four bedroom detached house, situated within a quiet cul-de-sac in the historic market town of Westbury. The property is a short walk to shops, schools, parks, and other local amenities.<br><br>Features include double glazing, gas central heating, spacious living room, large kitchen and separate dining room, fitted wardrobes in all bedrooms, three bathrooms, spacious enclosed rear garden, single garage, designated parking and utility room. This property also benefits from a partially boarded loft creating additional storage within the home.<br><br>Council tax band : D<br><br>Westbury is a small medieval market town which is famous for its White Horse hill-carving. The town offers a range of facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets and a post office. There is also a selection of coffee shops, restaurants, and public houses. Westbury is well positioned for all major road and railway connections with the mainline railway station offering links to London, Wales and the whole of the Southwest of England.</p><h3 class=\"listing-desc-header top\"><strong>Entrance</strong></h3><p class=\"top\">Upon entering the property you are greeted with doors to the living room, Kitchen, cupboard, downstairs cloakroom and stairs leading to the first floor.</p><h3 class=\"listing-desc-header top\"><strong>Living Room</strong></h3><p class=\"top\">The spacious living room benefits from a large double glazed window to front aspect, featured working gas fireplace, laminate wooden flooring throughout and double French doors leading onto the dining room.</p><h3 class=\"listing-desc-header top\"><strong>Dining Room</strong></h3><p class=\"top\">Adjacent to the living room you enter the dining room. The dining room comprises of ample space for all furnishings, double french door to the rear allowing convenient access to the garden. Wooden laminate flooring throughout, wall mounted radiator and a door leading to the kitchen.</p><h3 class=\"listing-desc-header top\"><strong>Kitchen</strong></h3><p class=\"top\">The kitchen comprises a double glazed window to rear aspect overlooking the garden a range of base units with granite effect work surfaces, One and a half bowl sink with drainer unit, space for fridge freezer, inset gas oven and hob built in spotlights, laminate tiled flooring breakfast bar and a door leading to the utility room.</p><h3 class=\"listing-desc-header top\"><strong>Utility</strong></h3><p class=\"top\">A door from the kitchen gives you access to the utility room. This room benefits from laminate work surfaces and a range of wall and base units. There is plumbing for a washing machine. Door to rear garden and access to garage.</p><h3 class=\"listing-desc-header top\"><strong>Master Bedroom</strong></h3><p class=\"top\">The master bedroom benefits from fitted wardrobes ideal for additional storage space. There are two double glazed windows which creates plenty of natural light and over looks the front of the property. There is a door to the en-suite which comprises; close coupled W.C, pedestal wash hand basin and mains fed shower.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Two</strong></h3><p class=\"top\">This double bedroom features a large double glazed window to rear aspect allowing lots of natural light into the room a radiator, double fitted wardrobe and is carpeted throughout.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Three</strong></h3><p class=\"top\">The third bedroom is a well proportioned room benefitting from a double glazed window, radiator and a fitted wardrobe providing storage.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Four</strong></h3><p class=\"top\">Bedroom four is another double room benefitting from a double glazed window to the front. There is a radiator, and carpet throughout. This room also features a fitted wardrobe.</p><h3 class=\"listing-desc-header top\"><strong>Bathroom</strong></h3><p class=\"top\">This well presented family bathroom benefits from large neutral tiled back splash, chrome heated towel rail, close coupled W.C, pedestal hand basin with storage, bath with mains fed shower over, and an extractor. An obscured double glazed window to the rear and laminate wooden flooring throughout.</p><h3 class=\"listing-desc-header top\"><strong>Garden</strong></h3><p class=\"top\">The fully enclosed rear garden benefits from a large laid to lawn area with a wooden storage shed to the rear. This garden also comprises of a patio area, great for additional seating and garden furnishings. Trees and plants surrounding the perimeter with side access to the front of the property where you will find driveway parking suitable for two vehicles.</p>",
