      "description": "<p class=\"top\"><strong>Agents</strong> <strong>note</strong> <strong></strong> This property is only available to buy to let investors as the property currently has a sitting tenant paying £675 per month.<br><br><strong>Why</strong> <strong>you'll</strong> <strong>like</strong> <strong>it........</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this delightful two bedroom cottage which is located in the heart of Westbury Leigh. It has all the benefits of a modern home with an updated kitchen and bathroom, whilst retaining some lovely period features.<br><br>The front door opens into the living room which has a wooden parquet floor, a feature fireplace and timber beams. The kitchen fitted with shaker style base and wall units with timber worktops and built in oven and hob.<br><br>The turning staircase leads from the living room to the first floor with, two bedrooms and a modern fitted bathroom.<br><br>The property benefits from a well presented rear garden with stunning views over countryside. It is fully enclosed with a number of landscaped levels with both timber decking and lawn areas, offering a very private setting. There is on road parking to the front.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury a small market town is situated at the western edge of Wiltshire beside the chalk down lands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire, makes it a delight for both the walker and cyclist and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong> To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Tanya Williams, Kieran Perks, Kerri Gunning or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
