      "description": "<p class=\"top\"><br><b>Summary</b><br>An exceptionally renovated Two Bedroom 1920's Character home with views of the Westbury White Horse has come to market. You will not want to miss out on this stunning two bedroom home with driveway parking, beautiful newly renovated interior and wonderful rear garden.<br><br><b>Description</b><br>The Ham is a beautifully renovated two bedroom 1920's character property set on the edge of the historic town of Westbury. Offering rolling field views to the front and overlooking the White Horse to the rear, the house is perfectly situated as well as being just a short distance to the train station which offers regular direct London Paddington Service.<br>The home has recently been completely refurbished and has an exceptional standard of detail, retaining 1930's character but with a modern touch. The home welcomes you from the driveway into the entrance hall, this leads through to the open plan ground floor accommodation made up of the living room, dining room and kitchen. To the first floor the home offers two double bedrooms as well as a beautiful four piece suite bathroom. The rear garden is a highlight to the home with laid lawn and path leading to additional space ideal for growing vegetables, planting and living \"The Good Life\". An additional feature is all interior doors of the property which are original and have been beautifully restored.<br>Westbury, set on the Wiltshire and Somerset border is a wonderful town offering a wealth of local amenities including three major super markets, as well as a range of independent businesses and restaurants. Westbury station is the key to the South West with a regular direct service to London Paddington, taking just over an hour, as well as linking to Bath, Bristol and down to Penzance.<br><br><b>Entrance Hall</b><br>Radiator. Original tiled floor. Front double glazed door. Fuse box<br><br><b>Lounge</b> 13' 9\" x 11' 3\" ( 4.19m x 3.43m )<br>Double glazed bay window to front. Original fire place. TV point. Carpeted. Original paneling.<br><br><b>Dining Room </b> 11' 10\" max x 11' 9\" max ( 3.61m max x 3.58m max )<br>Feature fire place. Two tall radiators. Tiled floor. Storage cupboard under stairs.<br><br><b>Kitchen</b> 13' 10\" x 11' 3\" ( 4.22m x 3.43m )<br>Double glazed window and French doors at rear. Wall and base units and drawers. AEG hob and extractor. Double oven. Kitchen island. Integrated Bosch dishwasher, Washing machine and fridge freezer. Generous preparation space. Radiator. Tiled floor.<br><br><b>Landing</b><br><br><b>Bedroom One</b> 14' 11\" x 11' 11\" ( 4.55m x 3.63m )<br>Two double glazed windows to front. Radiator. Original fireplace. Carpeted.<br><br><b>Bedroom Two</b> 11' 11\" x 9' 3\" ( 3.63m x 2.82m )<br>Double glazed window to rear. Original fireplace. Carpeted.<br><br><b>Bathroom</b><br>Double glazed frosted window to rear. Partially tiled walls. WC. Wash hand basin. Free standing bath. Walk in rainfall shower. Towel radiator. Rustic flooring.<br><br><b>Outside</b><br><br><b>Rear Garden</b><br>Generously sized with laid lawn and pathway leading to rear of the garden, with space for potential vegetable plot.<br><br><b>Driveway</b><br>Parking to the front of the property.<br><br>1. Money laundering regulations: Intending purchasers will be asked to produce identification documentation at a later stage and we would ask for your co-operation in order that there will be no delay in agreeing the sale.\r<br>2. General: While we endeavour to make our sales particulars fair, accurate and reliable, they are only a general guide to the property and, accordingly, if there is any point which is of particular importance to you, please contact the office and we will be pleased to check the position for you, especially if you are contemplating travelling some distance to view the property.\r<br>3. The measurements indicated are supplied for guidance only and as such must be considered incorrect.\r<br>4. Services: Please note we have not tested the services or any of the equipment or appliances in this property, accordingly we strongly advise prospective buyers to commission their own survey or service reports before finalising their offer to purchase.\r<br>5. These particulars are issued in good faith but do not constitute representations of fact or form part of any offer or contract. The matters referred to in these particulars should be independently verified by prospective buyers or tenants. Neither sequence (UK) limited nor any of its employees or agents has any authority to make or give any representation or warranty whatever in relation to this property.</p>",
