      "description": "<p class=\"top\"><br><b>Summary</b><br>Situated in the historic town of Westbury, Phipps close is a stunning four bedroom home, with a garage and driveway parking. The property offers generous internal accommodation as well as a beautiful, well kept rear garden.<br><br><b>Description</b><br>Phipps close is a stunning four bedroom home with a garage and driveway parking. Situated in the historic town of Westbury, the property offers generous internal accommodation, as well as a beautiful, well kept rear garden.<br>The home is well located in Westbury near to local amenities, stunning countryside walks as well as being near to Westbury Train station which offers a regular direct service to London Paddington.<br>This cared for home has been exceptionally well maintained and offers a generous accommodation for a family or couple to reside in. The property welcomes you with an entrance porch which leads into the ground floor accommodation made up of the living room, dining room, kitchen and utility room with additional cloakroom. On the first floor the property has four bedrooms, including a master with en suite and dressing room, as well as the family bathroom. The rear garden is a stunning retreat, with well manicured and landscaped features including a dining area, laid lawn and fringe bedding.<br>Westbury is famous for its White Horse carved into the Salisbury Plains welcoming you for stunning countryside walks and cycle routes through to the charming villages of Bratton, Edington and Earlstoke. Westbury station is the key to the South West with a regular direct service to London Paddington, taking just over an hour, as well as linking to Bath, Bristol and down to Penzance.<br><br><b>Entrance Porch</b><br>Double glazed composite door.<br><br><b>Dining Room</b> 15' 3\" x 12' 9\" ( 4.65m x 3.89m )<br>Double glazed window to front. Radiator. Stairs leading to the first floor<br><br><b>Lounge</b> 15' x 10' 8\" ( 4.57m x 3.25m )<br>Double glazed window to front. Feature fireplace. TV and phone connections. Radiator. Carpeted<br><br><b>Kitchen</b> 12' 7\" x 9' 2\" ( 3.84m x 2.79m )<br>Double glazed window and French doors to rear. Tiled walls. Wall and base units. Stainless steel sink and double drainer. Gas hob and extraction fan. Integrated dishwasher. Integrated Neff double oven.<br><br><b>Utility Room</b> 12' 7\" x 9' 2\" ( 3.84m x 2.79m )<br>Tiled walls. Wall and base units. Plumbing for washing machine and drier. Boiler. Room for fridge freezer.<br><br><b>Cloak Room</b><br>Double glazed frosted window to rear. WC. Wash hand basin. Radiator. Tiled floor.<br><br><b>Bathroom</b><br>Tiled walls, Bath. WC. Wash hand basin. Shower. Radiator.<br><br><b>Bedroom One</b> 12' 3\" x 9' 3\" ( 3.73m x 2.82m )<br>Double glazed window to rear. TV connectionsl. Radiator. Carpet.<br><br><b>Dressing Room</b><br>Fitted wardrobes.<br><br><b>En Suite</b><br>Double glazed frosted window to rear. WC. Wash hand basin. Electric shower cubicle. Towel radiator.<br><br><b>Bedroom Two</b> 12' 11\" x 7' 7\" ( 3.94m x 2.31m )<br>Double glazed window to front. TV connections. Radiator. Carpet.<br><br><b>Bedroom Three</b> 10' x 7' 2\" ( 3.05m x 2.18m )<br>Double glazed window to front. TV connections. Radiator. Carpet. Loft access.<br><br><b>Bedroom Four</b> 10' x 7' 2\" ( 3.05m x 2.18m )<br>Double glazed window to side. Radiator. Carpet.<br><br><b>Outside</b><br><br><b>Front Garden</b><br>Low maintenance patio area.<br><br><b>Rear Garden</b><br>South facing. External water tap. External power. Patio area. Wooden decked area. Grass lawn. Pathways. Stone edging. Gate to side. Glass pergola.<br><br><b>Garage</b> 18' x 8' ( 5.49m x 2.44m )<br>Electric Door. Double glazed door to side.<br><br>1. Money laundering regulations: Intending purchasers will be asked to produce identification documentation at a later stage and we would ask for your co-operation in order that there will be no delay in agreeing the sale.\r<br>2. General: While we endeavour to make our sales particulars fair, accurate and reliable, they are only a general guide to the property and, accordingly, if there is any point which is of particular importance to you, please contact the office and we will be pleased to check the position for you, especially if you are contemplating travelling some distance to view the property.\r<br>3. The measurements indicated are supplied for guidance only and as such must be considered incorrect.\r<br>4. Services: Please note we have not tested the services or any of the equipment or appliances in this property, accordingly we strongly advise prospective buyers to commission their own survey or service reports before finalising their offer to purchase.\r<br>5. These particulars are issued in good faith but do not constitute representations of fact or form part of any offer or contract. The matters referred to in these particulars should be independently verified by prospective buyers or tenants. Neither sequence (UK) limited nor any of its employees or agents has any authority to make or give any representation or warranty whatever in relation to this property.</p>",
