      "thumbnail_url": "https://lid.zoocdn.com/80/60/53bb2807e328c98f9c51c0ba0b57474669960b7d.jpg",
      "short_description": "<p class=\"top\">Daykin Estates are delighted to offer for sale, this well presented four bedroom detached house, situated within a the historic market town of Westbury. The property is a short walk to shops, schools, parks, pubs and other local amenities.  Features include UPVC double glazing, gas central heating, spacious living/dining room, large kitchen area with integrated appliances four well presented bedrooms, family bathroom, spacious enclosed rear garden situated on two levels, garage, designated driveway parking for multiple vehicles.  Westbury is a small medieval market town which is famous for its White Horse hill-carving. The town offers a range of facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets and a post office. There is also a selection of coffee shops, restaurants, and public houses. Westbury is well positioned for all major road and railway connections with the mainline railway station offering links to London, Wales and the whole of the Southwest of England.</p><h3 class=\"listing-desc-header top\"><strong>Entrance</strong></h3><p class=\"top\">Upon entering the property you are greeted with doors to the Living/Dining area, Kitchen, Downstairs cloakroom and stairs to the first floor.</p><h3 class=\"listing-desc-header top\"><strong>Living/ Dining Room</strong></h3><p class=\"top\">To the front of the property you will find the spacious living room. This room benefits from ample space for all living room furnishings. Large UPVC double glazed window to front aspect allowing plenty of natural light into the room. Carpeted throughout and a remote control gas fireplace mounted on the wall. Adjacent to the living room, you will find the dining room. This area benefits from wooden flooring throughout and double doors providing convenient access to the rear garden.</p><h3 class=\"listing-desc-header top\"><strong>Kitchen</strong></h3><p class=\"top\">This kitchen offers a range of matching wall and base units with granite effect work surfaces, stainless steel kitchen sink, integrated appliances including oven, four ring hob with extractors over, dishwasher and fridge/freezer. Situated within this room is boiler and a plenty of cupboards providing ample storage space.</p><h3 class=\"listing-desc-header top\"><strong>Master Bedroom</strong></h3><p class=\"top\">The master bedroom benefits from large UPVC double glazed windows to front aspect and is carpeted throughout. Additional benefits to this room include walk in wardrobe and en quite comprising of a close coupled W.C, pedestal wash hand basin, mains fed shower and extractor.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Two</strong></h3><p class=\"top\">This well sized bedroom features a large UPVC double glazed window with views of the rear garden, a radiator and laminate flooring throughout.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Three</strong></h3><p class=\"top\">The third bedroom is a well proportioned room benefitting from a UPVC double glazed window to front aspect, radiator, carpeted throughout and has a fitted cupboard benefiting from additional storage space.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Four</strong></h3><p class=\"top\">Bedroom four is another well sized bedroom benefitting from a UPVC double glazed window to the rear aspect allowing lots of natural light into the room. This well decorated room also benefits from carpet throughout and a radiator.</p><h3 class=\"listing-desc-header top\"><strong>Bathroom</strong></h3><p class=\"top\">The family bathroom benefits from obscured UPVC double glazed windows to rear aspect, close coupled W.C, pedestal hand basin, p shaped bath with mains fed shower over, and an extractor.</p><h3 class=\"listing-desc-header top\"><strong>Garden</strong></h3><p class=\"top\">The spacious well presented south east facing rear garden benefits being on two levels. The lower level is mostly block paving with convenient sheltered areas with lean to coverings. Steps leading to the raised laid to lawn area with a large wooden roofed pagoda, this also benefits from power and lighting. The garden also features an integrated BBQ.</p><h3 class=\"listing-desc-header top\"><strong>Garage And Driveway</strong></h3><p class=\"top\">The garage benefits from power and lighting, this area is perfect for ample storage space. Boarded loft has also been added to this area with a ladder for access creates additional storage space. The garage also benefits from an electric garage door. The secure electric gated driveway provides privacy from neighbors but also allows parking for multiple vehicles.</p>",
