      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this beautifully presented three bedroom Victorian home located within close walking distance to Westbury's local amenities and mainline railway station.<br><br>The property comes to the market with single story planning permission to the rear!<br><br>A standout feature of this lovely property is its impressive master bedroom. The room offers ample space for all bedroom furnishings and has fitted wardrobes stretching the width of the room. A feature bay window brings in an abundance of natural light. A door leads into the en-suite which offers a shower, double wash hand basin and W/C.<br><br>The property comprises and benefits from uPVC double glazing, gas central heating, spacious lounge with feature bay window and wood burner, a second reception room which could be utilised as an addition bedroom or home office, fitted kitchen/dining room with ample wall and base mounted cabinets, space for appliances and a generous space for a good size dining table and chairs. There is a shower room located to the rear of the property.<br><br>The first floor takes you to the master bedroom benefitting from built in wardrobes and en-suite, bedroom three which is a good size double, and the stunning bathroom suite which includes a free standing bath with over head shower, wash hand basin and W/C.<br><br>Stairs rise to the second floor where you will fine the second bedroom which is 17ft in length and offers a set of double built in wardrobes. The room offers far reaching views of Westbury including the White Horse and All Saints Church.<br><br>Externally there is a fully enclosed rear garden which is mainly laid to lawn and offers mature shrubs and trees. There is a large hard standing area which offers ample space for garden furnishings and benefits from a great deal of space for a good size garden shed.<br><br>The front of the home has a blocked paved driveway with parking for multiple vehicles.<br><br>Agents Note:<br><br>This fantastic property comes to the market with the added benefit of no onward chain. Additional reception room on the ground floor is in need of some cosmetic work. An internal viewing is highly recommended to fully appreciate what this lovely home has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury a small market town is situated at the western edge of Wiltshire beside the chalk down lands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire, makes it a delight for both the walker and cyclist and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Tanya Williams, Kieran Perks, Kerri Gunning or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
