      "thumbnail_url": "https://lid.zoocdn.com/80/60/5cf4af40502962dd6adba83717b62003279e9182.jpg",
      "description": "<strong>This development offers the following schemes:<br><br><ul><li>Help to Buy: Equity Loan 2021 - 2023</li><li>Part Exchange</li><li>Home Change</li></ul><br><br>Schemes are available on selected plots only, subject to status, terms and conditions apply. Contact the development for latest information.</strong><br /><br />The extremely popular Hanbury is a three-bedroom family home with a bright and modern open-plan kitchen/dining room with French doors leading into the garden. The downstairs WC, three handy storage cupboards and an en suite to bedroom one mean it ticks all the boxes for practical family living.<br><br><b>Additional Information</b><br><ul><li>Tenure: Freehold</li><li>Council tax band: Not made available by local authority until post-occupation</li></ul><h3>Rooms</h3><br /><strong>Ground Floor</strong><br /><ul><li>Kitchen/Dining Room (4.68 x 2.69 m)</li><li>Living Room (4.35 x 3.69 m)</li></ul><strong>First Floor</strong><br /><ul><li>Bedroom 1 (3.65 x 2.9 m)</li><li>Bedroom 2 (2.81 x 2.32 m)</li><li>Bedroom 3 (2.32 x 1.78 m)</li></ul><h3>About Horseshoe Meadow 2</h3><br />Surrounded by the beautiful Wiltshire countryside and close to historic landmarks the Westbury White Horse and Stonehenge, Westbury is a thriving market town with much to offer. From the Georgian houses that line the historic marketplace, to the range of local shops and eateries, to the plentiful amenities including schools and a train station, it's no wonder this friendly town is a popular choice for buyers of new homes.<br><br>Horseshoe Meadow 2 sits in the south west of the town, within easy walking distance of essential amenities such as a convenience store and pharmacy, train station and local community centre – a vibrant asset to the area which hosts a number of weekly groups and events. With all this in place, plus great transport links to Frome, Trowbridge and Bath, could this be your perfect place to call home?<br /><br /><h3>Leisure</h3><br />Wiltshire is home to some of England's most glorious countryside, and living at Horseshoe Meadow you'll be perfectly positioned to enjoy it all. The wide open landscape of Salisbury Plain stretches out from the south-eastern edge of Westbury, combining grassland habitats with ancient landmarks Stonehenge and Westbury's own white horse carving. There are several long walks to enjoy across the Plain, or for something the whole family will enjoy, White Horse Country Park is just a few minutes from the town and offers a fishing lake, golf course and children's play area.<br /><br /><h3>Education</h3><br />Westbury and the surrounding area benefits from a good selection of local education facilities, including 'Outstanding' Cygnets Pre-school just half a mile from Horseshoe Meadow, and Westbury Infant School, Westbury Junior School and Matravers secondary school and sixth form all within easy reach.<br /><br /><h3>Shopping</h3><br />Shops in Westbury include an Aldi, Morrisons, Lidl and Tesco Express, as well as a number of independent stores, takeaways, cafes and pubs. The town holds a gp and dentists, library and sports clubs. You can find local produce at the weekly market, and for a wider shopping experience travel to the neighbouring and very lovely towns of Frome, Warminster or Trowbridge. You won't be far from city attractions, either – just a half-hour drive (or 24-minute direct train journey) away is beautiful Bath, with its fantastic shopping and historic sights.<br /><br /><h3>Transport</h3><br />Though the proximity to rural landscapes is a great benefit of this location, you'll also be well-positioned to make the most of local transport links. Westbury sits on the A350, putting Warminster, Trowbridge and Melksham within easy reach, while beautiful Frome is just a 13-minute drive away. You can also access all these towns in a matter of minutes via rail thanks to Westbury train station, which also operates direct services to Bath (24 minutes) Bristol (38 minutes) and London (1 hour 18 minutes).<br /><br /><h3>Opening Hours</h3><br />Monday 10:00 - 17:00, Tuesday Closed, Wednesday Closed, Thursday 10:00 - 17:00, Friday Closed, Saturday 10:00 - 17:00, Sunday 10:00 - 17:00<br /><br />",
