      "description": "<p class=\"top\"><br><b>Summary</b><br>Warminster Road is a stunning four bedroom character property, with original features through out and a large rear garden, situated in the historic town of Westbury. The property is near to local amenities, stunning countryside walks as well as direct London line train station.<br><br><b>Description</b><br>Warminster Road is a stunning four bedroom character property, with original features through out and a large rear garden, situated in the historic town of Westbury. The property is near to local amenities, stunning countryside walks as well as direct London line train station.<br>Westbury, set on the Wiltshire and Somerset border is a wonderful town offering a wealth of local amenities including three major super markets, as well as a range of independent businesses and restaurants. The town has stunning historic buildings including the first ever public swimming pool set in the heart of the old town. Westbury is famous for its White Horse carved into the Salisbury Plains welcoming you for stunning countryside walks and cycle routes through to the charming villages of Bratton, Edington and Earlstoke. Westbury station is the key to the South West with a regular direct service to London Paddington, taking just over an hour, as well as linking to Bath, Bristol and down to Penzance.<br><br><b>Entrance Porch</b><br>Double glazed front door. Fuse box. Gas box. Tiled floor.<br><br><b>Entrance Hall</b><br>Carpet. Original tiles underneath.<br><br><b>Bedroom Two</b> 15' 11\" x 8' 9\" ( 4.85m x 2.67m )<br>Currently divided into two rooms via a partition wall. Ground floor. Carpet. Radiator. Front double glazed window. Built in wardrobe. TV point. Beam work.<br><br><b>Bedroom Three</b> 10' 5\" x 9' ( 3.17m x 2.74m )<br>Ground floor. Carpet. Radiator. Front double glazed window. Built in wardrobe. Chimney breast.<br><br><b>Dining Room</b> 16' 11\" x 12' 10\" ( 5.16m x 3.91m )<br>Laminate floor. Side double glazed window. Store cupboard. Log burner. Radiator. Back of boiler access. Radiator.<br><br><b>Kitchen</b> 13' 2\" x 8' 10\" ( 4.01m x 2.69m )<br>Wall and base units. Space for American Fridge/Freezer. Integrate 4 ring gas hob. Tiled floor. Rear double glazed wooden frame window. Side double glazed window. Dishwasher space. Breakfast bar/island. Integrated electric oven. Side double glazed door. Radiator. Part tiled walls. Porcelain sink and drainer. Boiler cupboard.<br><br><b>Shower Room</b><br>W.C. Wash hand basin and vanity. Shower cubicle. Tiled floor. Rear double glazed window. Radiator. Spotlights.<br><br><b>Utility Cupboard</b><br>Power. Space for washing machine and tumble dryer.<br><br><b>Landing</b><br>Huge storage/linen cupboard. Carpet. Loft access.<br><br><b>Lounge</b> 17' 3\" x 13' 1\" ( 5.26m x 3.99m )<br>Side double glazed window. Rear double glazed window. Radiator. Laminate flooring. Rear double glazed door with access onto the sun terrace. Study area. Loft access.<br><br><b>Bedroom One</b> 15' 11\" x 8' 2\" ( 4.85m x 2.49m )<br>Front double glazed windows x2. Wall lights x2. TV point. Radiator. Built in wardrobe. Carpet.<br><br><b>Bedroom Four</b> 10' 5\" x 9' ( 3.17m x 2.74m )<br>Front double glazed window. Carpet. Radiator.<br><br><b>Bathroom</b><br>W.C. Wash hand basin. Roll top bath. Bidet. Spotlights. Radiator. Tiled walls. Rear double glazed window. New wooden flooring.<br><br><b>Outside</b><br><br><b>Rear Garden</b><br>Laid lawn. Raised beds. Pond. Power sockets. Raised vegetable patch. Private. Secure. Shed x3. Patio dining. Water supply. Apple trees. Plum trees. Chicken run.<br><br><b>Sun Terrace</b><br>Raised wooden decked sun terrace. South facing.<br><br><b>Outbuilding</b> 13' 8\" x 13' ( 4.17m x 3.96m )<br>Power. Light. Front double glazed door. Front double glazed window. Planning permission not required.<br><br><b>Parking</b><br>Public car park free 6pm - 8pm. Separate agreement for £30 a month with a parking space on Hospital Road - further details to be supplied. Street parking nearby.<br><br>1. Money laundering regulations: Intending purchasers will be asked to produce identification documentation at a later stage and we would ask for your co-operation in order that there will be no delay in agreeing the sale.\r<br>2. General: While we endeavour to make our sales particulars fair, accurate and reliable, they are only a general guide to the property and, accordingly, if there is any point which is of particular importance to you, please contact the office and we will be pleased to check the position for you, especially if you are contemplating travelling some distance to view the property.\r<br>3. The measurements indicated are supplied for guidance only and as such must be considered incorrect.\r<br>4. Services: Please note we have not tested the services or any of the equipment or appliances in this property, accordingly we strongly advise prospective buyers to commission their own survey or service reports before finalising their offer to purchase.\r<br>5. These particulars are issued in good faith but do not constitute representations of fact or form part of any offer or contract. The matters referred to in these particulars should be independently verified by prospective buyers or tenants. Neither sequence (UK) limited nor any of its employees or agents has any authority to make or give any representation or warranty whatever in relation to this property.</p>",
