      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this well presented newly refurbished three bedroom detached bungalow located within a quiet tucked away position.<br><br>A standout feature of this lovely property is its open plan living accommodation. The room benefits from a fitted kitchen area with integrated fridge/freezer, dishwasher, built in oven and gas hob. There is a breakfast bar with seating with storage cupboards to one side. There is also ample space for lounge furnishings. The room is finished with bi-fold doors which lead out onto the rear garden.<br><br>The property comprises and benefits from upvc double glazing, gas central heating, open plan living accommodation, utility room, three double bedrooms with en-suite to the master bedroom, and a newly fitted bathroom suite.<br><br>Externally there is a low maintenance, south facing rear garden which offers a large patio area.<br><br>The front of the home has a good size driveway with parking for multiple vehicles.<br><br>Agents Note:<br><br>This fantastic property comes to the market with the added benefit of no onward chain. An internal viewing is highly recommended to fully appreciate what this lovely home has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury a small market town is situated at the western edge of Wiltshire beside the chalk down lands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire, makes it a delight for both the walker and cyclist and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Tanya Williams or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
