      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong><br>Martin &amp; Co are delighted to offer for sale this beautifully presented four/five double bedroom detached character home located within the popular village of Westbury Leigh.<br><br>A standout feature of this lovely property is its spacious lounge. The room is laid to oak flooring and benefits from underfloor heating and a fantastic working wood burner. A beautiful bay window overlooks the front garden and gives the home character. French doors lead onto the enclosed rear garden.<br><br>The property comprises and benefits from gas central heating, sash windows, high ceilings throughout, a spacious lounge with open fire, French doors, underfloor heating and feature bay window, a fitted kitchen/breakfast room with a range of wall and base mounted cabinets, dual aspect windows and plenty of space for table and chairs.<br><br>There is a separate dining room which is laid to parquet flooring and carpet. There is ample space for a good size dining table and chairs as well as lounge furnishings. Dual aspect windows bring an abundance of natural light into the home. A feature working fireplace is located to one corner and stairs lead up to the first floor offering great storage facilities below.<br><br>There is also a good size utility room, downstairs W/C and a study. This area has the fantastic potential to be converted into a one-bedroom granny annex!<br><br>Leading upstairs brings you to a good size landing, with doors leading to all four bedrooms and the family bathroom suite. The master bedroom is located to the far end of the hallway and offers ample space for all bedroom furnishings and a great deal of storage. A door leads to the four-piece bathroom suite which includes a double corner shower, separate free-standing bath, wash hand basin and W/C.<br><br>The second bedroom offers dual aspect windows giving views of the front and rear garden and offers space for all bedroom furnishings.<br><br>Bedrooms three and four are both fantastic double rooms overlooking the rear garden.<br><br>Bedrooms two, three and four are served by the family bathroom suite which includes a bath with overhead shower, W/C, wash hand basin and underfloor heating.<br><br>Externally there is a low maintenance rear garden which is mainly laid to patio. Steps lead to a raised area which is laid to gravel.<br><br>The front of the home benefits from the impressive front garden which is mainly laid to lawn and offers mature trees, shrubs and plants. There is a large, decked area which offers space for garden furnishings.<br><br>The large block paved driveway benefits from parking for multiple vehicles. A detached single garage has been converted into two rooms. The front is currently being used as storage accessed by the up and over garage door and the back section offers a workshop/study area.<br><br>The driveway is secured with double wooden gates giving the home plenty of privacy.<br><br>An internal viewing is highly recommended to fully appreciate what this beautiful home has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury a small market town is situated at the western edge of Wiltshire beside the chalk down lands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire, makes it a delight for both the walker and cyclist and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Tanya Williams, Kieran Perks, Kerri Gunning or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
