      "thumbnail_url": "https://lid.zoocdn.com/80/60/33f79c1c662abe6d4e6f45ce8487a6405686518c.jpg",
      "description": "<p class=\"top\">Lot 12<br><h3 class=\"listing-desc-header top\"><strong>For sale by online auction</strong></h3><br>Thursday 26th may<br>guide price £370,000+<br><br>Purpose built block of 4 flats situated only a short walk from the town centre.<br>Currently, fully let and producing £2,175pcm which equates to £26,100 per annum.</p><h3 class=\"listing-desc-header top\"><strong>Situation &amp; Discription</strong></h3><p class=\"top\">Purpose built block of 4 flats situated only a short walk from the town centre. Currently, fully let and producing £2,175pcm which equates to £26,100 per annum.<br><br>Close to local amenities and within walking distance of the town centre. Westbury has a good local range of shopping, leisure facilities and schooling as well as a railway station providing access to London. Nearby Warminster, Trowbridge and the City of Bath provide a more extensive range of leisure, retail and schooling with the A350 providing good access to the M4 and A303.<br><br>The 4x1 bedroom apartments have been recently renovated to a high standard and each flat comprises of entrance hall, lounge, kitchen, bedroom and shower room. There are outside communal areas.<br>An excellent investment opportunity with all tenants on AST's. Further tenancy information will be available in the legal pack.<br><br>Joint Auctioneers<br>Martin &amp; Co<br>Westbury</p><h3 class=\"listing-desc-header top\"><strong>Viewings</strong></h3><p class=\"top\">To arrange a viewing, contact: Auction office on There will be numerous pre-arranged open house viewing slots lasting for 30 minutes and you can book in by contacting the Auctioneers.<br><br>If you have any concerns with viewings, please contact the relevant Strakers office and we would be happy to discuss them with you and hopefully put you at ease.</p><h3 class=\"listing-desc-header top\"><strong>Legal Pack</strong></h3><p class=\"top\">You can download the legal packs via our website  and going to the auction home page by using the services heading at the top of the page. Click on the light blue tab under the next auction date displayed on the calendar. This will produce a lot list, select a lot of interest, this pulls up further details on the property - on the right under the photos click View Legal Documents - You will need to sign-up by entering your email address and creating a password the first time but this will stay valid for all of our future auctions. The legal pack may not be available straight away, but as long as you have registered to receive it you will be notified as soon as it is available.</p><h3 class=\"listing-desc-header top\"><strong>Reserve &amp; Guide Price</strong></h3><p class=\"top\">Generally speaking Guide Prices are provided as an indication of each seller's minimum expectation. They are not necessarily figures which a property will sell for and may change at any time prior to the auction. Virtually every property will be offered subject to a Reserve (a figure below which the Auctioneer cannot sell the property during the auction) which we expect will be set within the Guide Range or no more than 10% above a single figure Guide.</p><h3 class=\"listing-desc-header top\"><strong>+ Fees</strong></h3><p class=\"top\">If you are the successful bidder, you will then be asked to sign the auction contract and pay a 10% deposit and a buyers fee of £600 including VAT on any Lots purchased at or below £99,999 or £1,200 including VAT on any lots purchased at £100,000 or above.</p><h3 class=\"listing-desc-header top\"><strong>Disclaimer</strong></h3><p class=\"top\">These particulars, whilst believed to be accurate are set out as a general outline only for guidance and do not constitute any part of an offer or contract. Intending purchasers should not rely on them as statements of representation of fact, but must satisfy themselves by inspection or otherwise as to their accuracy. No person in this firms employment has the authority to make or give any representation or warranty in respect of the property. All measurements and distances are approximate only. Your home is at risk if you do not keep up repayments on a mortgage or other loan secured on it.</p>",
