      "description": "<p class=\"top\">No onward chain - Tucked away in a quiet cul-de-sac, this two bedroom detached bungalow requires some updating but offers it's new owner a great opportunity to put their own stamp on a lovely home.</p><h3 class=\"listing-desc-header top\"><strong>Location</strong></h3><p class=\"top\">The town of Westbury has main road links to the towns of Warminster and Frome and the city of Salisbury to the south and to the county town of Trowbridge to the north.<br>Through Trowbridge are main road links to the M4 junction 17, offering access to the cities of Bath and Bristol and to the thriving commercial centre of Swindon.<br>The railway station at Westbury is a major transport hub, offering direct links to Bath (25 minutes), Bristol (45 minutes), the South West and London Paddington (1 hour and 28 minutes).</p><h3 class=\"listing-desc-header top\"><strong>Description</strong></h3><p class=\"top\">No onward chain - Tucked away in a quiet cul-de-sac, this two bedroom detached bungalow requires some updating but offers it's new owner a great opportunity to put their own stamp on a lovely home. The accommodation comprises an entrance hall, lounge/dining room, kitchen, two bedrooms and bathroom. Further benefits include Upvc double glazing, gas central heating, garage, drive and a good size, enclosed rear garden.</p><h3 class=\"listing-desc-header top\"><strong>Entrance Hall</strong></h3><p class=\"top\">You enter into the entrance hall through a Upvc double glazed entrance door, there is a radiator and doors to the lounge/dining room and storage cupboard.</p><h3 class=\"listing-desc-header top\"><strong>Lounge/Dining Room</strong> (5.9 x 2.8 (19'4\" x 9'2\"))</h3><p class=\"top\">There is a Upvc double glazed window to the front, feature feature with inset fire, radiator and doors to the kitchen and inner hall.</p><h3 class=\"listing-desc-header top\"><strong>Kitchen</strong> (3.3 x 2.7 (10'10\" x 8'10\"))</h3><p class=\"top\">There is a sink unit insert into a hard top work surface, range of base, drawer and wall mounted cabinets, electric cooker point, radiator, double glazed window and door.</p><h3 class=\"listing-desc-header top\"><strong>Inner Hall</strong></h3><p class=\"top\">Doors to both bedrooms and a storage cupboard.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom One</strong> (3.9 x 2.7 (12'10\" x 8'10\"))</h3><p class=\"top\">There is a double glazed window to the rear and a radiator.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Two</strong> (2.9 x 2.3 (9'6\" x 7'7\"))</h3><p class=\"top\">Bedroom two has a radiator and a Upvc double glazed door to the rear garden.</p><h3 class=\"listing-desc-header top\"><strong>Bathroom</strong></h3><p class=\"top\">There is an obscure Upvc double glazed window to the side, a panelled bath with electric shower over and glazed folding screen, pedestal wash hand basin, low level W.C and radiator</p><h3 class=\"listing-desc-header top\"><strong>Exterior</strong></h3><h3 class=\"listing-desc-header top\"><strong>Front</strong></h3><p class=\"top\">Lawn with path to the front door, outside light, gate to the rear garden and side door to the kitchen.</p><h3 class=\"listing-desc-header top\"><strong>Rear Garden</strong></h3><p class=\"top\">The enclosed rear garden has a paved patio, lawn, metal storage shed and gated access to the front of the property.</p><h3 class=\"listing-desc-header top\"><strong>Drive</strong></h3><p class=\"top\">Providing off road parking.</p><h3 class=\"listing-desc-header top\"><strong>Garage</strong></h3><p class=\"top\">With up and over door to the front.</p><h3 class=\"listing-desc-header top\"><strong>Additional Information</strong></h3><p class=\"top\">Council Tax Band - B</p><h3 class=\"listing-desc-header top\"><strong>Directions</strong></h3><p class=\"top\">As you enter Westbury from Trowbridge Road, take the third exit at the roundabout onto The Mead. Follow the road and take the third left hand turning into Gloucester Walk, then the first right into Devon Drive. The property can be found at the head of the first cul-de-sac on the right.</p><p class=\"top\">You may download, store and use the material for your own personal use and research. You may not republish, retransmit, redistribute or otherwise make the material available to any party or make the same available on any website, online service or bulletin board of your own or of any other party or make the same available in hard copy or in any other media without the website owner's express prior written consent. The website owner's copyright must remain on all reproductions of material taken from this website.</p>",
