      "description": "<p class=\"top\">***** Grade II Listed House *****<br><br>We are delighted to offer to the market this characterful, three-bedroom Grade II listed terraced home on Maristow Street, Westbury.<br><br>The property is well presented throughout, and the accommodation is spread spaciously across two floors, with further scope to extend into the loft area (lapsed planning for a loft conversion). The property comprises to the ground floor; an extensive entrance hallway which breaks out into a front reception room which is naturally bright and spacious and lends itself nicely for spending time collectively with the family or for individual activities, a downstairs four-piece bathroom suite, a separate dining area which is substantial in size and a stand out feature room of this lovely home, which offers ample space for family entertainment; a modern-fitted kitchen with stairs that lead up to a separate utility room.<br><br>Stairs lead up to the first floor which further comprises a single bedroom across the landing, two generous double bedrooms and a shower room.<br><br>Externally the property has a fully enclosed private garden which is mainly laid to lawn with a patio seating area which can be accessed via the utility room. There is also rear access onto the church walkways.<br><br>Maristow Street is ideally situated within the small market town of Westbury, on the western edge of Wiltshire beside the chalk downlands that form Salisbury Plain. Westbury White Horse is the most famous landmark of the area and there are also a selection of shopping and leisure facilities close by including schools, churches, library, supermarkets, and the oldest swimming pool in the country. There are also a selection of coffee shops, restaurants, and public houses. Westbury is exceptionally positioned for all major road and railway connections with the mainline railway station offering links to London (just under 1.5 hours), Wales and the whole of the South West of England.<br><br>Viewing highly recommended to appreciate the opportunity on offer.<br><br></p><h3 class=\"listing-desc-header top\"><strong>Reception Room</strong> (4.6m x 3.3m)</h3><h3 class=\"listing-desc-header top\"><strong>Study</strong> (3.04m x 1.78m)</h3><h3 class=\"listing-desc-header top\"><strong>Bathroom</strong> (3.6m x 2.5m)</h3><h3 class=\"listing-desc-header top\"><strong>Dining Room</strong> (4.9m x 3.6m)</h3><h3 class=\"listing-desc-header top\"><strong>Kitchen</strong> (3.3m x 1.8m)</h3><h3 class=\"listing-desc-header top\"><strong>Utility Room</strong> (2.3m x 1.7m)</h3><h3 class=\"listing-desc-header top\"><strong>Shower Room</strong> (3.1m x 2.1m)</h3><h3 class=\"listing-desc-header top\"><strong>Bedroom 1</strong> (4.8m x 2.7m)</h3><h3 class=\"listing-desc-header top\"><strong>Bedroom 2</strong> (3.8m x 2.4m)</h3><h3 class=\"listing-desc-header top\"><strong>Bedroom 3</strong> (3.8m x 2.2m)</h3>",
