      "short_description": "<p class=\"top\">Daykin Estates are delighted to offer for sale, this two bedroom detached bungalow, situated within the historic market town of Westbury. This property is a short walk to shops, schools, parks, pubs, Westbury train station and other local amenities.  Features include UPVC double glazed windows, gas central heating, spacious living/ dining room, kitchen, two double bedrooms, family bathroom, conservatory, enclosed rear garden and driveway parking for multiple vehicles and a garage.  Council tax band: C  Westbury is a small medieval market town which is famous for its White Horse hill-carving. The town offers a range of facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets and a post office. There is also a selection of coffee shops, restaurants, and public houses. Westbury is well positioned for all major road and railway connections with the mainline railway station offering links to London, Wales and the whole of the Southwest of England.</p><h3 class=\"listing-desc-header top\"><strong>Entrance Hallway</strong></h3><p class=\"top\">You enter the property into a spacious hallway with doors leading to all rooms.</p><h3 class=\"listing-desc-header top\"><strong>Kitchen</strong></h3><p class=\"top\">The Kitchen offers a range of matching wall and base units with wood effect work surfaces, inset stainless steel sink, built in electric oven, inset electric hob, space for fridge/freezer and washing machine. There is a UPVC double glazed window with views of the side of the property.</p><h3 class=\"listing-desc-header top\"><strong>Lounge</strong></h3><p class=\"top\">The spacious lounge room is situated to the front of the property. There is a UPVC double glazed window to the front which creates plenty of natural light throughout the day.</p><h3 class=\"listing-desc-header top\"><strong>Bathroom</strong></h3><p class=\"top\">The bathroom offers a close coupled W.C, pedestal wash hand basin, shower over, and extractor. Ceramic flooring. This room also benefits from obscured UPVC double glazed window.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom One</strong></h3><p class=\"top\">The master bedroom is a spacious room and benefits from a UPVC double glazed window with views to the rear.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Two</strong></h3><p class=\"top\">The second bedroom is a generous size and has access to the conservatory from this room.</p><h3 class=\"listing-desc-header top\"><strong>Conservatory</strong></h3><p class=\"top\">To the rear of the property you will find the conservatory which offers ample storage. Windows, which run the full length of three walls, offers amazing natural light. The door to the rear gives convenient access to the garden.</p><h3 class=\"listing-desc-header top\"><strong>Garden</strong></h3><p class=\"top\">The landscaped garden is fully enclosed with side access to the front of the property and door leading to the garage. The garden has both a lawn and patio area with raised area to the rear.</p>",
