      "description": "<p class=\"top\"><strong>Why</strong> <strong>you'll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this stunning brand new three double bedroom home, situated in a small exclusive development close to local amenities and Westbury's mainline railway station<br><br>This brand-new property is approximately 1200 square feet and has been finished to an extremely high standard, offering luxury fixtures and fittings throughout and a south facing rear garden.<br><br>The property comprises and benefits from gas central heating (underfloor heating to ground floor) high performance windows, downstairs WC and oak staircase and doors.<br><br>The luxury fitted kitchen is located to the front with quartz worktops, integrated appliances including a dishwasher and washing machine.<br>At the rear of the property, you have a large living room and dining area with Upvc French doors opening onto the garden.<br><br>Moving upstairs you will find three double bedrooms, all served by a luxury fitted bathroom: With bath and separate shower. Further benefits include karndean flooring to the entrance hall, kitchen, cloakroom and bathroom.<br><br>You also have fibre broadband ready, the added peace of mind of a 10-year guarantee and the governments help to buy scheme is also available.Externally you have a south facing fully enclosed garden and the added benefit of two parking spaces.<br><br><strong>For</strong> <strong>your</strong> <strong>inormation</strong> <strong></strong><br>Agents Note - The photos attached are of the show home, so could be slightly different and floor plans a mirror image.<br><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency</p>",
