      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this immaculately presented three bedroom detached bungalow located on a sought after location offering far reaching views.<br><br>A standout feature of this lovely property is its modern fitted kitchen/breakfast room. The room benefits from ample wall and base mounted cabinets, integrated hob and oven, space for a fridge/freezer and a two seater breakfast bar. The room has a large window which bring in an abundance of natural light and overlooks the rear garden.<br><br>The property comprises and benefits from upvc double glazing, gas central heating, spacious lounge, fitted kitchen/breakfast room, utility room, hobby room, study, conservatory, two double bedrooms and a good size single bedroom. There is also a four piece bathroom suite and a separate W/C.<br><br>Externally, there is a fully enclosed landscaped rear garden which is mainly laid to lawn and lined with mature trees, shrubs and plants. There is a large patio area offering space for garden furnishings. To the rear of the property there are two good size sheds and beautiful views of adjoining paddocks. A side gate gives convenient access to the front of the home.<br><br>To the front is the large driveway with parking for multiple vehicles. There is also a raised lawn area lined with mature trees.<br><br>An internal viewing is highly recommended to fully appreciate what this lovely property has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury a small market town, situated on the western edge of Wiltshire beside the chalk downlands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire. The surrounding countryside makes it a delight for both the walker and cyclist and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Tanya Williams or Ed Hames.<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
