      "listing_date": "2022-04-16 09:08:12",
      "description": "<p class=\"top\">Daykin Estates are delighted to offer for sale, this well presented two bedroom semi detached bungalow, situated within a quiet cul-de-sac in the historic market town of Westbury. The property is a short walk to shops, schools and other local amenities.<br><br>Features include UPVC double glazing, Gas central heating, spacious lounge/dining room, kitchen, two well proportioned bedrooms, bathroom, spacious landscaped enclosed rear garden, single garage, and a large driveway creating ample parking for multiple vehicles.<br><br>Westbury is a small medieval market town which is famous for its White Horse hill-carving.<br>The town offers a range of facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets and a post office. There is also a selection of coffee shops, restaurants, and public houses. Westbury is well positioned for all major road and railway connections with the mainline railway station offering links to London, Wales and the whole of the Southwest of England.</p><h3 class=\"listing-desc-header top\"><strong>Entrance Hall</strong></h3><p class=\"top\">You enter the property into a spacious hallway with doors leading to all rooms. There are two cupboards, one for storage and the other is the airing cupboard.</p><h3 class=\"listing-desc-header top\"><strong>Living Room</strong></h3><p class=\"top\">The spacious lounge/dining room is situated at the rear of the property and has ample space for soft furnishings and a dining table and chairs if desired. This room has french doors leading out to the garden. The patio doors create plenty of natural light throughout the day.</p><h3 class=\"listing-desc-header top\"><strong>Kitchen</strong></h3><p class=\"top\">The kitchen has a range of matching wall and base units with a granite effect work surface, built-in stainless-steel sink unit, inset electric oven, inset gas hob, checkered splash back and ceramic tiled flooring. There is ample space for fridge/freezer and washing machine and has a door leading out to the conservatory.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom One</strong></h3><p class=\"top\">The master bedroom benefits from a large UPVC double glazed window creating plenty of natural light and over looks the front of the property.</p><h3 class=\"listing-desc-header top\"><strong>Bedroom Two</strong></h3><p class=\"top\">The second bedroom is a generous size and is situated at the front of the property and benefits from a UPVC double glazed window.</p><h3 class=\"listing-desc-header top\"><strong>Bathroom</strong></h3><p class=\"top\">The Family Bathroom has an obscured UPVC double glazed window, chrome heated towel rail, close coupled W.C, pedestal wash hand basin, bath with mains fed shower over and an extractor.</p><h3 class=\"listing-desc-header top\"><strong>Conservatory</strong></h3><p class=\"top\">To the rear of the property you will find the conservatory which offers ample storage. Windows, which run the full length of two walls, offers amazing natural light. The door to the rear gives convenient access to the garden.</p><h3 class=\"listing-desc-header top\"><strong>Garden</strong></h3><p class=\"top\">The well sized, low maintenance enclosed rear garden benefits from a large raised laid to lawn area. The rear garden also features both patio and decking area perfect for additional seating.</p><h3 class=\"listing-desc-header top\"><strong>Garage</strong></h3><p class=\"top\">The garage benefits from electricity and is situated at the end of the driveway with access from the front and to the side leading onto the garden and offers ample storage.</p>",
