      "description": "<p class=\"top\"><strong>Why</strong> <strong>youll</strong> <strong>like</strong> <strong>it...</strong> <strong></strong> Martin &amp; Co are delighted to offer for sale this beautifully presented four bedroom semi-detached family home located within the heart of Westbury, and within close walking distance to local amenities and mainline railway station.<br><br>A standout feature of this fantastic property is its 21ft dining/family room which is located to the rear of the property. The room offers ample space for lounge furnishings as well as space for a good size dining table and chairs. French doors open up onto the enclosed rear garden and bring in an abundance of natural light. The spacious room is laid with beautiful oak flooring.<br><br>The property comprises and benefits from upvc double glazing, gas central heating, a large entrance hall which is laid to parquet flooring, a spacious lounge with feature fireplace and bay window, a brilliant size dining/family room, fitted kitchen/breakfast room and a modern downstairs shower room. There are three double bedrooms to the first floor which are served by the three piece family bathroom. The second floor leads to the master bedroom which has built in wardrobes and ample space for all furnishings.<br><br>Externally, there is a fully enclosed rear garden which is mainly laid to lawn. The landscaped garden has been well kept and offers mature shrubs and plants with a pathway leading to the rear of the garden where you will find a good size garden shed and a large patio area which is a fantastic sunny spot for entertaining.<br><br>The front of the home benefits from driveway parking and gives access into the garage with double doors and a window.<br><br>An internal viewing is highly recommended to fully appreciate what this impressive home has to offer.<br><br><strong>Property</strong> <strong>location</strong> <strong></strong><br>Westbury a small market town, situated on the western edge of Wiltshire, beside the chalk downlands that form Salisbury Plain. The most famous landmark of the area is the vastly impressive Westbury White Horse which is both the oldest and largest White Horse in Wiltshire, making it a delight for both walkers and cyclists and the area also provides the perfect location for air sports.<br><br>The town offers a range of shopping and leisure facilities including, library, sports and leisure centre, schools, churches, doctors, dentist surgeries, three supermarkets, post office and the oldest swimming pool in the country. We also have a varied selection of coffee shops, restaurants, public houses and a popular wine bar.<br><br>Westbury is exceptionally well positioned for all major road and railway connections with the mainline railway station offering links to London (1 hour 26 minutes), Wales and the whole of the South West of England.<br><br><strong>Viewing</strong> <strong>arrangements</strong> <strong></strong><br>To view this property please call, John Hames, Luke Hames, David Hames, Sally Suter, Lewis Sinden, Louisa Derrick, Ed Hames, Tanya Williams or Kim Butt on .<br><br><strong>For</strong> <strong>your</strong> <strong>information</strong> <strong></strong><br>Martin &amp; Co Westbury haven't tested any of the appliances listed in these details, or asked for warranty or service certificates, unless stated – they're on an 'as seen' basis.<br><br>You should only use floor plans and measurements as a general guide to room layout and design, as they're not exact. Potential buyers are advised to recheck the measurements before completion.<br><br>Money Laundering Regulations: Purchasers will be asked to produce identification and proof of residency documentation, once an offer has been agreed, we need to hold this on file before solicitors can be instructed.</p>",
